import styled from "styled-components";

export const ConteinerStyle = styled.div`
background-color:black;
color: white;
display: grid;
grid-template-columns: 1fr 1fr 1fr;
grid-template-rows: 1fr 1fr 1fr 1fr;
justify-items: center;
align-items: center;
row-gap:50px;
column-gap:50px;
margin-top:50px;
margin-bottom:50px;

`
export const CamisetaStyle = styled.div`
display:grid;
grid-template-columns: 1fr ;

justify-items: center;
row-gap: 25px;
`
